            var sticky = 50;
            const leftSidebar = document.querySelector("#left-sidebar")
            const toggleButton = document.querySelector(".toggle-btn")
            if (window.pageYOffset >= sticky) {
                if (leftSidebar) {
                    leftSidebar.style.top = "14%";
                } else {
                    leftSidebar.style.top = "18%";
                }

                if (toggleButton) {
